            "_id": 3,
            "Story": "第 33550335 个故事，我还在找寻那个答案。<br><br>其中一个故事里，金发的织者放弃了制衣师的工作，和猫儿一起成为了自由的侠盗。<br>在另一个故事里，狮子般的王子健康地长大，他战无不胜，从来没人能增添他的伤痕。<br>也有几次，红发的女孩们会被好心的王者保护，奥赫玛满是她们的欢声笑语。<br>我还见过，海洋的歌者与那位凯撒一同回到了无人居住的海滨，阿那克萨戈拉斯担任逐火的首领，带领众人向前……<br><br>可每一个故事的结尾，都像徒劳燃烧的书页，化作一个漆黑的怪物。<br>你说，它有很多个名字——<br>「铁墓」，「毁灭」，或者…「命运」。<br><br>桃子，你总是微笑着，但你讲述时的每一次颤抖，我都能感受到呀。<br>那就是「逐火」的结局吗？<br>每一个故事里，都写着「逐火是不断失却的旅途」。<br>你说，那也是「爱」。<br>所以，「爱」是一次次的失却，也是一次次的等待吗？<br><br>桃子，我不懂。<br>但我感受到了，你说的那颗「流星」。<br>我的「心」在和它一同跳动。<br><br>奔向它，可能会跌落，碎成万千个碎片。<br>嘻，反过来想，碎片就像水晶花一样，会倒映出更多美丽的眼眸吧？<br><br>在这一次的故事里，涟漪将为流星而荡开…三千万世浇灌的花朵，也终于要飘向远方。<br>我知道的，接下来，我会失去好多的记忆，就像花瓣片片落下。但只有这样，我才能更加轻盈地、乘着风儿去追逐流星呀♪<br><br>那么，就让人家成为桃子故事中的小妖精吧，人家会用粉色的绒毛打扮自己，以最可爱的样子，接过每一个「昔涟」的嘱托，去人们心中栽种「爱」的水晶花——<br><br>然后，以「昔涟」的名字，和流星一起，写下不同以往的浪漫故事♪<br><align=\"right\">——「昔涟」的回忆</align>"
